import React from 'react'
import axios from 'axios'


class LogoutUser extends React.Component{
    componentDidMount(){
        axios.delete('http://localhost:3006/users/logout', {
            headers: {
                'x-auth': localStorage.getItem('userAuthToken')
            }
        })
    }
    render(){
        return(
            <div>

            </div>
        )
    }
}
export default LogoutUser
